import React from "react";

export default function ImageUpload() {
  return (
    <div className="mb-3">
      <label htmlFor="productName" className="form-label">
        Image
      </label>
      <input
        type="text"
        className="form-control"
        style={{ height: "6rem" }}
        id="productName"
        name="productName"
      />
    </div>
  );
}
